const Persons = (props) => {
    const liStyle = {
        color: 'grey',
        listStyleType: "",
        marginLeft: 10,
        marginright: 10,
      }
    const ulStyle = {
        textDecoration: ""
    }
    return(

 <ul style={ulStyle}>
{props.persons.map((person) => <li style={liStyle} key={person.id}>
                                {person.name} : {person.number}
                            <button onClick={() => props.onDelete(person.id)} >Delete</button>      
                            </li>)}
 </ul>
 )}

export default Persons
